      'field_author_info_view_id' => 'views_author_info:block',
      'field_author_info_arguments' => 'NULL',
      'field_description_value' => 'FORMATION PROFESSIONNELLE AUX METIERS DE LA BANQUE ET DE LA MICRO FINANCE - DEVENEZ EXPERT BANCAIRE INTERNATIONAL AVEC CERTIFICATION INTERNATIONALE ISO 9001 DU CANADADans le cadre de la promotion des métiers de la microfinance et de la banque, le cabinet CEMI EXPERT Arrête n°043/MENEFOP/SG/DFDP/SDGSF/SACD N° RCCM RC / DLN / 2018/ A / 1534 N° : Contribuable P017112709571W] organise une formation dédiée aux jeunes diplômés de toutes les filières académiques, désirant faire carrière dans le domaine de la banque ou de la microfinance en tant qu’Expert bancaire avec certification internationale ISO 9001 du Canada.Pendant la formation, vous bénéficierez du Mentorat d\'experts bancaires déjà en exercice au sein des Cabinets partenaires. Après la formation, l’apprenant en fonction de son niveau d’études, pourra :Diriger ou créer un cabinet d\'expertise.Créer et développer les institutions financières dans son pays ou à l\'international.Administrer, liquider ou redresser les institutions financières en difficulté.Ouvrir des agences bancaires et de micro finance.Recruter le personnel pour les institutions financières.FORMER ET RENFORCER LES CAPACITES DU PERSONNEL BANCAIRE.Dispenser les formations dans les grandes écoles et universités en tant qu\'Expert bancaire. Mobiliser les fonds au profit des organisations.Rechercher le financement pour les entreprises etc.Recouvrir les créances.Mobiliser des foules et rechercher la clientèle.Réaliser des diagnostics institutionnel et organisationnel.Devenir intermédiaire, conseiller, courtier financier auprès des entreprises.Concevoir et proposer des produits financiers. Etc...FORMATION THÉORIQUE :MODULE 1Comment maîtriser les secteurs bancaires et microfinance dans la zone CEMAC? 350 questions et réponsesMODULE 2Comment maîtriser les lois, normes et règlements instruits par la COBAC?400 questions et réponsesMODULE 3 - CONTRÔLE INTERNEComment maîtriser l\'intérieur d\'une banque?270 Questions et réponsesMODULE 4 - CRÉDIT MANAGEMENTComment placer le crédit et réussir le recouvrement de créances à 99 %?200 questions et réponsesMODULE 5Comment maîtriser la gestion du personnel dans une entreprise?200 questions et réponsesMODULES 6Comment placer le crédit auprès des populations afin de leur permettre de créer ou de développer leurs affaires?250 questions et réponsesMODULE 7Comment appliquer la comptabilité dans le domaine bancaire?270 questions et réponsesMODULE 8Comment créer et développer une institution financière?200 questions et réponsesMODULE 9Comment mobiliser les fonds? Comment rechercher le financement au profit des Institutions Financières?200 questions et réponsesMODULE 10Gouvernance et déontologie professionnelle dans une institution financière?Pendant que vous étudierez seul, ou en groupe, ici au cabinet ou dans votre service, vous serez régulièrement invité à rejoindre une équipe à l\'étranger ou au Cameroun pour l\'exécution des missions d\'expertise.FORMATION PRATIQUE :Pendant la formation, il est OBLIGATOIRE de faire le stage au cabinet en cas de mission d’expertise dans une Institution financière.PUBLIC CIBLEProfessionnel de la banque et de la Micro finance visant un grade supérieur ;Chercheur d’emploi ;Étudiant ;Travailleur ;Toute personne souhaitant faire une reconversion professionnelle.PARCHEMINS AU TERME DE LA FORMATION1 Attestation de Qualification Professionnelle1 Certificat d\'Expert Bancaire1 Lettre de recommendation1 Relevé de notes1 Guide de professionnalisation1 Quitus d\'adhésion au réseau des experts bancaires francophones1 Boite à outils de l\'expert bancaireNIVEAU MINIMUM REQUISBACC et PlusCOUT DE LA FORMATIONLa formation des Experts Bancaires Internationaux coûte 850 000 FCFA.COMPOSITION DU DOSSIERUne Photocopie de la CNI légalisée ou de l’acte de naissance ;Une photocopie du dernier diplôme ;Quatre [04] photos 4X4.Possibilité de s’inscrire en ligne. NOMBRE DE PLACES LIMITÉES : 30 ',
